import React from 'react';
import { useParams } from 'react-router-dom';
import fakeData from '../fakeData/operators.json';

let { id } = useParams();

const operator = (fake) => {
  return fake.id == { id };
};

const Payment = () => {
  return <div>{fakeData.find(operator).name}</div>;
};

export default Payment;
